import React, { Component } from "react";

export default class MobileNavigationComponent extends Component {
  render() {
    return (
      <div className="nav-line ">
        <ul>
          <li>
            <div className=" line-s "></div>
          </li>
          <li>
            <div className=" line-l "></div>
          </li>
          <li>
            <div className=" line-s2 "></div>
          </li>
        </ul>
      </div>
    );
  }
}
